import AlbumSearch from './AlbumSearch'
import { Routes, Route } from 'react-router-dom'

function App() {
    return (
        <Routes>
            <Route path='/:artist/:album' element={ <AlbumSearch/> } />
            <Route path='/AlbumSearch/:artist/:album' element={ <AlbumSearch/> } />
        </Routes>
    )
}
  
export default App
